const flujoConsulta = addKeyword(['hola', 'buenas', 'consulta', 'Hola'])
    .addAnswer(
        '¡Hola! Vamos a realizar una consulta vehicular. Por favor responde a las siguientes preguntas.',
        { capture: false },
        (ctx) => {
            console.log('Iniciando consulta:', ctx.from);
            userData.phone_number = ctx.from;
        }
    )
    .addAnswer(
        '¿Cuál es tu nombre (oficial)?',
        { capture: true },
        async (ctx) => {
            console.log('Nombre recibido:', ctx.body);
            userData.name = ctx.body; // Guarda el nombre del usuario
        }
    )
    .addAnswer(
        '¿Cuál es tu apellido (oficial)?',
        { capture: true },
        async (ctx) => {
            console.log('Apellido recibido:', ctx.body);
            userData.last_name = ctx.body; // Guarda el apellido del usuario
        }
    )
    .addAnswer(
        '¿Cuál es tu número de solicitud?',
        { capture: true },
        async (ctx) => {
            console.log('Número de solicitud recibido:', ctx.body);
            userData.request_number = ctx.body; // Guarda el número de solicitud
        }
    )
    .addAnswer(
        '¿Qué tipo de consulta deseas realizar?\n1. Antecedentes de la persona\n2. Datos vehiculares',
        { capture: true },
        async (ctx, { flowDynamic }) => {
            const option = ctx.body.trim();
            console.log('Opción seleccionada:', option);
            if (option === '1') {
                userData.request_type = 'antecedentes_persona';
                await flowDynamic([{ body: 'Has seleccionado *Antecedentes de la persona*.' }]);
                await flowDynamic([{ body: 'Por favor, ingresa el nombre de la persona a consultar.' }]);
            } else if (option === '2') {
                userData.request_type = 'datos_vehiculares';
                await flowDynamic([{ body: 'Has seleccionado *Datos vehiculares*.' }]);
                await flowDynamic([{ body: '¿Cuál es la placa del vehículo?' }]);
            } else {
                await flowDynamic([{ body: 'Opción no válida. Por favor, selecciona 1 o 2.' }]);
            }
        }
    )
    .addAnswer(
        null, // Aquí generamos las preguntas dinámicamente según la elección
        { capture: true },
        async (ctx, { flowDynamic, endFlow }) => {
            console.log('Datos de usuario:', userData); // Verifica si los datos son correctos
            if (userData.request_type === 'antecedentes_persona') {
                if (!userData.person_name) {
                    userData.person_name = ctx.body;
                    console.log('Nombre de la persona:', userData.person_name);
                    await flowDynamic([{ body: '¿Cuál es el apellido paterno de la persona?' }]);
                } else if (!userData.person_last_name) {
                    userData.person_last_name = ctx.body;
                    console.log('Apellido paterno de la persona:', userData.person_last_name);
                }
            } else if (userData.request_type === 'datos_vehiculares') {
                if (!userData.plate) {
                    userData.plate = ctx.body;
                    console.log('Placa del vehículo:', userData.plate);
                    await flowDynamic([{ body: '¿Cuál es el número de serie del vehículo?' }]);
                } else if (!userData.serial_number) {
                    userData.serial_number = ctx.body;
                    console.log('Número de serie del vehículo:', userData.serial_number);
                }
            }

            // Enviar los datos al backend solo si tenemos todos los datos necesarios
            if (userData.serial_number || userData.person_last_name) {
                try {
                    console.log('Enviando datos al backend:', userData);
                    const response = await axios.post('http://127.0.0.1:8000/api/v1/save-request/', userData);
                    console.log('Datos enviados al backend:', response.data);
                    return endFlow('¡Gracias! Tu solicitud ha sido enviada al sistema para su análisis.');
                } catch (error) {
                    console.error('Error al enviar datos al backend:', error);
                    return endFlow('Hubo un problema al enviar tu solicitud. Por favor, inténtalo más tarde.');
                }
            } else {
                console.log('Faltan datos para enviar.');
                await flowDynamic([{ body: 'Por favor, asegúrate de haber completado todas las preguntas.' }]);
            }
        }
    );
